    "agGrid.export.dialog.help2": "<p>&nbsp;</p>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>time zone:\n\t\t\t\t\t\t<br />\n    ginstr internally stores all data in UTC time zone; this is the universal time which\n    is the same worldwide. Before presenting dates and times on the screen, each\n    timestamp is adopted to the time zone selected on your ginstr web preferences. This\n    option can be used to override the time zone settings on the ginstr web set up which\n    might be useful in case you will send the data to someone who works in another time\n    zone. Default value depends on your settings on the ginstr web set up.\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n            <div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>International call prefix:\n\t\t\t\t\t\t<br />\n                        This feature allows you to select either ‘+’ or ‘00’ prefix to international phone numbers exported as a file.\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n\t\t\t<p>Export of numbers, dates, times and pointers into Excel file formats. Excel shows\n  content according to its settings. This means for ex. that if a date is exported as \"1\n  January 2017\" but Excel is opened in German time zone then the date will be shown as\n  \"1. Januar 2017\". Each table is exported with one additional column: \"record created\n  on\". The value in this column stores the record creation date which is used for\n  filtration in case of a &lsquo;big data&rsquo; table.</p>\n\t\t\t<p>Access to media files (pictures, videos, audio files, documents) after download:</p>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>Export without attachments:\n\t\t\t\t\t\t<br />\n      In this case the URL of the media files will be stored in the .csv or .xlsx or .xml\n      file, so you can access these files at any time directly on the ginstr cloud\n      without requiring a password.\n\t\t\t\t\t\t<br />\n      In case a table cell contains references to multiple files, then the URLs will be\n      separated by &ldquo;|&rdquo;.\n\t\t\t\t\t\t<br />\n      Example: &ldquo;http://ginstr/image1.jpg|http://ginstr/image2.jpg&rdquo;\n\t\t\t\t\t\t<br />\n      These links will be available until the attachments (or the entire row which\n      contained such attachments) will be deleted on the ginstr cloud.\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n\t\t\t<p>&nbsp;</p>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>Export with attachments:\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<div>\n\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t<li>Tables not belonging to a ginstr app:\n\t\t\t\t\t\t\t\t\t<br />\n          In this case the .csv / .xlsx / .xml file will contain relative links to the\n          appropriate files in the archive folder. For example\n          &ldquo;pictures/image1.jpg&rdquo; in single table export will mean that this\n          file is placed inside the archive at the following path:\n          &ldquo;/pictures/image1.jpg&rdquo;.\n\t\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Tables belonging to a ginstr app:\n\t\t\t\t\t\t\t\t<br />\n        In this case &ldquo;pictures/image1.jpg&rdquo; of &ldquo;customers&rdquo; table\n        will be stored in the archive at the following path:\n        &ldquo;/customers/pictures/image1.jpg&rdquo;.\n\t\t\t\t\t\t\t\t<br />\n        Like for export without attachments several files stored in single cell of a\n        ginstr table will be shown with &ldquo;|&rdquo; separator. For example\n        &ldquo;pictures/image1.jpg|image2.jpg&rdquo;\n\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t</ul>\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>",
    "agGrid.export.dialog.help1": "<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>columns filter:\n\t\t\t\t\t\t<br />\n      ginstr tables allows you to hide and show columns of tables. Please access the help\n      feature or the \n\t\t\t\t\t\t<a href=\"http://wiki.ginstr.com/index.php/ginstr_web\" target=\n      \"_blank\">ginstr web user manual</a> for detailed information. This feature allows\n      you to define whether the data of the entire column tables should be downloaded or\n      only the visible data independent of any specified criteria.\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<div>\n\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t<li>all columns:\n\t\t\t\t\t\t\t\t\t<br />\n          this feature allows to download the data of all columns of a table independent\n          of currently applied columns visibility settings\n\t\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>visible columns:\n\t\t\t\t\t\t\t\t<br />\n        in case you have applied hide column feature and few columns remain hidden then\n        this option will allow you to download the current shown columns on your PC\n\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t</ul>\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>language:\n\t\t\t\t\t\t<br />\n      a large number of ginstr apps are available in multiple languages. The language\n      selection does not only affect the UI of the apps on the phone but also the\n      headlines of the tables. This feature allows you to select the language in which\n      the headlines of the downloaded tables will be stored in the .csv or .xlsx or .xml\n      file. Default value depends on your settings on the ginstr web set up.\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n\t\t\t<p>&nbsp;</p>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>time format:\n\t\t\t\t\t\t<br />\n      ginstr supports multiple time formats. This option allows defining in which time\n      format the data should be downloaded. This might be relevant for you because the\n      software that will be used for further processing the data might have some\n      restrictions in this regards. Default value depends on your settings on the ginstr\n      web set up.\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n\t\t\t<p>&nbsp;</p>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>date format:\n\t\t\t\t\t\t<br />\n      ginstr supports multiple date formats. This option allows defining in which date\n      format the data should be downloaded. This might be relevant for you because the\n      software that will be used for further processing the data might have some\n      restrictions in this regards. Default value depends on your settings on the ginstr\n      web set up.\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n\t\t\t<p>&nbsp;</p>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>number format:\n\t\t\t\t\t\t<br />\n      ginstr supports multiple number formats. This option allows defining in which\n      number format the data should be downloaded. This might be relevant for you because\n      the software that will be used for further processing the data might have some\n      restrictions in this regards. Default value depends on your settings on the ginstr\n      web set up.\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>",
