    "autoreport.table.dialog.helpcontent": "<br>\n<p>This feature allows you to configure scheduled reports based on data stored in tables.</p>\n<p>Each automated scheduled table report is saved as separate row in system table \"system: automated reports\" where one can modify the settings of the scheduled report at any time.</p>\n<p>All automated reports are sent by way of an attachment with the e-mail.</p>\n<p> On the occasion of an error related to an automated report, the description of the error can be found in system table \"system: automated reports - errors\".</p>\n<p>The following options are available to configure the automated scheduled table report:</p>\n<ul>\n<li>report name<br>\nthis allows you to define the name of the automated table report. This field is mandatory and if left empty an error message will be displayed when trying to save the report configuration.</li>\n<br>\n<li>to<br>\nhere you enter the e-mail addresses where the report will be sent. This field is mandatory and if left empty or e-mail is in an incorrect format, an error will be displayed when trying to save the report configuration.</li>\n<br>\n<li>cc<br>\nhere you can enter the e-mail addresses where the report will be sent as a carbon copy. This field is optional.</li>\n<br>\n<li>bcc<br>\nhere you can enter the e-mail addresses where the report will be sent as a blind carbon copy. This field is optional.</li>\n<br>\n<li>subject<br>\nthis field allows you to enter the subject of an e-mail. This field is mandatory and if left empty an error message will be displayed when trying to save the report configuration. Predefined value for subject is \"$reportType &ndash; from $dateFrom to $dateTo\".<br>This setting can be edited at any time. On the right side of the subject field you can find a dropdown which allows you to select the variables that can be added to the subject field. These variables will be populated with runtime data whenever the report is created.<br>The following variables are available:</li>",
