    "LABEL_STARTING_VALUE": "starting value",
    "autoreport.pentaho.dialog.helpcontent3": "<br>\n<li>time zone<br>\nhere you can select the time zone which will be used in the formatted automated reports to be sent. The time zone selection can be modified in the \"system: automated reports\" table.</li>\n<br>\n<li>show thousands delimiter<br>\nhere you can define if the thousands delimiter will be used in columns with number datatype in the formatted automated reports to be sent.</li>\n<br>\n<li>international call prefix<br>\nhere you can select if 00 or + should be used as international call prefix for phone numbers stored in columns with phone number datatype</li>\n</ul>\n<p>filtering of data:</p>\nthe records of a table to be included in the scheduled formatted report depend on the filter settings.<br>\nIn case no filter settings are applied to the table while creating the formatted automated report configuration then a formatted automated report will be created containing all records stored in the related table. This can be used for an automated data backup on top of the backups which are created regularly and automatically in the ginstr cloud.<br>\nIn case a filter has been applied to the table while creating the formatted automated report configuration then only the formatted automated reports will be created for records in the related table matching the filter settings.<br>\n??? In case the related table contains at least one column with date or with date&time datatype AND in case a filter has been defined for these columns then only records will be included in the report for which the dates match the defined ‘periodicity’ setting.",
    "autoreport.pentaho.dialog.helpcontent2": "<br>\n<li>scheduled date<br>\nthis feature allows you to define the start date of the e-mails to be sent with a formatted automated report as attachment. Depending on selected report frequency configured in the frequency dropdown, this date is automatically changed to match the frequency setting as follows:<br>\n- daily &#9658; today<br>\n- weekly &#9658; start of next week<br>\n- monthly &#9658; start of next month<br>\n- weekend &#9658; next weekend.<br>\nEach time you create a formatted automated report configuration, an instant e-mail will be sent to verify the configuration set-up. The report will be sent at the time specified here on the days specified by the frequency.\nReports will always be created for the previous time period as defined by the frequency setting:<br>\n- daily: all data from yesterday<br>\n- weekly: all data from last week<br>\n- monthly: all data from last month<br>\n- weekend: all data from last weekend</li>\n<br>\n<li>type<br>\nhere you can select in which format the formatted automated report will be sent. Available formats are CSV, EXCEL, PDF and RTF.</li>\n<br>\n<li>language<br>\nhere you can select the language in which the formatted automated report will be sent.</li>\n<br>\n<li>date format<br>\nhere you can select the date format which will be used in the formatted automated reports to be sent.</li>\n<br>\n<li>time format<br>\nhere you can select the time format which will be used in the formatted automated reports to be sent.</li>",
    "tms.config.max.ccp": "max. CCP",
    "WIDGET_QR_TEXT_READ_ONLY_HINT": "scan the qr value",
    "aggrid.contextmenu.csvExportApplicationWithAttachments": "export all tables of this ginstr app including attachments (.zip)",
    "autoreport.pentaho.dialog.helpcontent1": "</ul>\n<p style=\"padding-left: 60px;\">$dateFrom - inserts the start date of the time period of the actual report</p>\n<p style=\"padding-left: 60px;\">$dateTo - inserts the end date of the time period of the actual report</p>\n<p style=\"padding-left: 60px;\">$reportType - inserts the type of the report (in this case report type is “formatted report”)</p>\n<p style=\"padding-left: 60px;\">$reportName - inserts the name of the report defined in field \"report name\"</p>\n<p style=\"padding-left: 60px;\">$requestingUserAccount – inserts the user name of the account requesting the automated report</p>\n<ul>\n<li>body<br>\nthis field allows you to enter the text that will be shown in the body of the e-mail to be sent. This field is not mandatory. Predefined value is \"This automated report has been requested by $requestingUserAccount\". It can be edited at any time. The variables described in the subject section can also be used in this section with similar settings. On the right side of the subject field you can find a dropdown which allows you to select the variables that can be added to the body field. These variables will be populated with runtime data whenever the report is created.</li>\n<br>\n<li>frequency<br>\nthis setting allows you to select how often an e-mail will be sent with attached formatted report</li>\n<br>The following frequency options are available:</li>\n</ul>\n<p style=\"padding-left: 60px;\">daily – the report will be sent each day at scheduled time and will contain a report based on data as of the end of the previous day</p>\n<p style=\"padding-left: 60px;\">weekly - the report will be sent each first day of the week at scheduled time and will contain a report based on data as of the end of the previous week; first day of the week is either Sunday or Monday depending on the user settings for the account which requested the report</p>\n<p style=\"padding-left: 60px;\">weekend - the report will be sent each first day of the week at scheduled time and will contain a report based on data as of the end of the previous weekend; first day of the week is either Sunday or Monday depending on the user settings for the account which requested the report</p>\n<p style=\"padding-left: 60px;\">monthly - the report will be sent each first day of a month at scheduled time and will contain a report based on data as of the end of the previous month</p>\n<ul>\n<li>status<br>\nthis feature allows you to define if sending of the scheduled report is active or not. If report sending is active this means that e-mails with attached report will be sent as scheduled. If report sending is not active then no e-mails will be sent.</li>\n<br>\n<li>separate file per report<br>\nthis feature allows you to choose if the formatted reports will be sent as separated files or single file.<br>If ‘send in separate files’ is selected then a zip folder with separated files for each formatted report with appropriate type (CSV, EXCEL, PDF, RTF) will be attached to the e-mail.<br>\nIf the user decides not to send separate files then a single file, which includes all formatted reports, will be attached to the e-mail with required type (CSV, EXCEL, PDF, RTF).</li>",
    "accountConfig.design.user.logo.file.choose": "choose logo file",
