    "map.helpTip.content": "<p>This map portlet allows you to view GPS locations on a map from data stored in selected records of the currently active ginstr table that has one or multiple columns with the &lsquo;GPS&rsquo; datatype or geofences.</p>\n<ul>\n<li>A &lsquo;GPS&rsquo; column describes a specific coordinate, e.g. -12.340580, 40.234809.</li>\n<li>A &lsquo;geofence&rsquo; indicates an area on the map. This area can be named. That geofence name can then be used, for example, in ginstr apps or in ginstr web instead of displaying the numericGPS coordinate. This can make reports recorded in ginstr apps more readable.</li>\n</ul>\n<p>Each data record selected in a table will be presented as a &lsquo;pushpin&rsquo; or &lsquo;geofence&lsquo; in this map portlet.</p>\n<p>Pushpins are shown when you select data records in tables with visible GPS data type columns.</p>\n<p>If tables have multiple columns with a GPS data type, each of them will be shown whenever the column is visible.</p>\n<p>A geofence is shown when you select a data record in the table with a pointer to the &ldquo;system: geofences&rdquo; table and if the option &ldquo;geofences&rdquo; is selected in the &ldquo;Dropdown menu&rdquo; or via the &ldquo;Right mouse-click menu&rdquo;.</p>\n<p><strong>Map Navigation</strong></p>\n<p>You have the following options to pan the map:</p>\n<ul>\n<li>keyboard arrows:<br /> move the map to the right, left, top &amp; bottom accordingly in small steps</li>\n<li>shift + keyboard arrows:<br /> performs the same movements, but with medium steps</li>\n<li>arrows in the top left corner of this map portlet:<br /> performs the same movements, but with large steps</li>\n</ul>",
