    "autoreport.pentaho.dialog.helpcontent": "<br>\n<p>This feature allows you to configure formatted automated reports based on data stored in related tables.</p>\n<p>Each formatted automated report is saved as a separate row in table \"system: automated reports\" where one can modify all settings of the formatted automated report at any time</p>\n<p>All formatted automated reports are sent by way of an attachment with an e-mail.</p>\n<p>On the occasion of an error related to a formatted automated report, the description of the error can be found in system table \"system: automated reports - errors\"</p>\n<p>The following options are available to configure a formatted automated report:</p>\n<ul>\n<li>report name<br>\nthis allows you to define the name of the automated formatted report. This field is mandatory and if left empty an error message will be displayed when trying to save the report configuration.</li>\n<br>\n<li>to<br>\nhere you can enter the e-mail addresses where the report will be sent. This field is mandatory.</li>\n<br>\n<li>cc<br>\nhere you can enter the e-mail addresses where the report will be sent as a carbon copy. This field is optional.</li>\n<br>\n<li>bcc<br>\nhere you can enter the e-mail addresses where the report will be sent as a blind carbon copy. This field is optional.</li>\n<br>\n<li>subject<br>\nthis field allows you to enter the subject of an e-mail. This field is mandatory. Predefined value for subject is \"$reportType &ndash; from $dateFrom to $dateTo\".<br>\nThis setting can be edited at any time. On the right side of the subject field you can find a dropdown which allows you to select the variables that can be added to the subject field. These variables will be populated with runtime data whenever the report is created.<br>\nThe following variables are available:</li>",
