    "totals.helpTip.content": "<h3>Report settings</h3>\n\nThis screen allows to configure a report based on the data shown in tab 'raw data'.<br/>\nThere is a maximum of 20 different reports per portlet.<br/>\n<br/>\nThe top most input field allows to name the report. This name will be shown in the tab itself above the table. The name can consist of multiple words.<br/>\n<br/>\nEach line in section 'grouped columns' and in section 'ungrouped columns' represents one column in the report.<br/>\nIt is possible to drag a line from section 'ungrouped columns' to section 'grouped columns' and vice versa.<br/>\nIt is also possible to drag a line within a section up and down for rearranging the sequence of columns in the report.<br/>\n<br/>\n<u>Section 'grouped columns'</u><br/>\nThe columns listed in section 'grouped columns' are shown on the left side of the report in the given sequence from left to right.<br/>\nThe report will be sorted by all columns listed in section 'grouped columns'.<br/>\nThe sorting level is defined top-down by the sequence of the columns in section 'grouped columns'.<br/>\nBy clicking on the black triangle the sorting order (top-down or bottom-up) can be defined.<br/>\nFor each column listed in section 'grouped columns' a line with interim results will be added to the report for each different content.<br/>\n<br/>\n<u>Section 'ungrouped columns'</u><br/>\nThis section defines the sequence of all ungrouped columns. They are shown in the right part of the report in the given sequence.<br/>\nBy clicking on the black triangle the sorting order (top-down or bottom-up) can be defined.<br/>\nThe sorting order defined in section 'grouped columns' supersedes the sorting order given in section 'ungrouped columns'.<br/>\n<br/>\n<u>Section 'options'</u><br/>\nSection 'options' allows configuration of the following settings separately for reports shown in the browser (defined in column 'web') and for reports exported to .csv or Excel .xlsx files (column export):\n<ul>\n<li>show subtotals for each group of records</li>\n<li>show totals at the end of the report</li>\n<li>show percentages / averages for each group of records</li>\n<li>show percentages / averages at the end of the report</li>\n<li>count other content</li>\n<li>count checkboxes</li>\n</ul>\nEach option can be activated / deactivated by clicking on the related icon.<br/>\n<br/>\n<u>Buttons</u><br/>\nOn top of the screen there are 3 buttons:\n<ul>\n<li>apply<br/>\nstores all settings and applies them immediately to the modified report;<br/>\ncreates additional report in case this report has not been created before</li>\n<li>cancel<br/>\ndiscards all recent modifications and restores the original report</li>\n<li>delete<br/>\ndeletes the selected report; please note that deleting a report does NOT delete any data nor does it affect any other report.</li>\n</ul>",
