    "agGrid.export.dialog.help": "<p>This export feature allows to download the stored data from ginstr tables to your\n  local PC.</p>\n\t\t\t<p>The export feature can be used for creating data backup on a customer&rsquo;s PC in\n  addition to the default back up availability on ginstr cloud.</p>\n\t\t\t<p>In case of .csv file export format each table will be represented as a separate .csv\n  file. In case of .xlsx export format each table will be represented as a separate sheet\n  inside one single .xlsx file. In case of .xml file format the information contained in\n  all tables will be stored in one single .xml file.</p>\n\t\t\t<p>To download a table related to any ginstr app from the online management software\n  which is called ginstr web, right click anywhere on the table and then select the\n  &lsquo;download data&rsquo; option. The popup window would guide you through the steps\n  to download the data.</p>\n\t\t\t<p>The following options are available to configure the data download:</p>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>export format:\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<div>\n\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t<li>csv:\n\t\t\t\t\t\t\t\t\t<br />\n            files with .csv extension are commonly used to exchange data between\n            different applications. For example if you would like to further process your\n            data e.g. through a dispatching or bookkeeping software then the data can be\n            exported from the ginstr tables to a .csv file and from there can be imported\n            into any 3rd party software.\n\t\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>Excel:\n\t\t\t\t\t\t\t\t<br />\n          This feature allows to create Microsoft Excel compatible files with .xlsx file\n          extension. Excel 2007 or newer version is required to open such files; .xlsx\n          files can hold up to 1 million records.\n\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>XML:\n\t\t\t\t\t\t\t\t<br />\n          This option creates a file with .xml file extension.\n\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t</ul>\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n\t\t\t<p>&nbsp;</p>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>include attachments:\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<div>\n\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t<li>yes:\n\t\t\t\t\t\t\t\t\t<br />\n            If this option is selected then the data will be downloaded as a compressed\n            .zip file:\n\t\t\t\t\t\t\t\t\t<br />\n            - the nature of file can be .csv, .xlsx and .xml depending on the export\n            format selection\n\t\t\t\t\t\t\t\t\t<br />\n            - all media files (e.g. .png image files, .wav sound files etc.)\n\t\t\t\t\t\t\t\t\t<br />\n            Depending on your operating system and version there are different steps on\n            how to extract a .zip file into individual files. In case you don&acute;t\n            know how to do this please contact your system administrator.\n\t\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>no:\n\n            \n\t\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t\t<li>downloading data of a specific table: in this case individual .csv or\n              .xlsx or .xml file will be downloaded depending on the chosen export\n              format</li>\n\t\t\t\t\t\t\t\t\t<li>downloading of all the tables of a ginstr app: in this case the data of\n              all the tables of the selected ginstr app will be compressed and downloaded\n              as a .zip file.</li>\n\t\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t</ul>\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n\t\t\t<p>&nbsp;</p>\n\t\t\t<div style=\"margin-left: 2em\">\n\t\t\t\t<ul>\n\t\t\t\t\t<li>rows filter:\n\t\t\t\t\t\t<br />\n        ginstr tables provide a multitude of options to filter and sort the content of\n        tables. Please access the help feature or the \n\t\t\t\t\t\t<a href=\n        \"http://wiki.ginstr.com/index.php/ginstr_web\" target=\"_blank\">ginstr web user\n        manual</a> for detailed information. This feature allows you to configure the\n        filter settings and download data as a whole or for any selected table\n        entry.\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<div>\n\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t<li>all rows:\n\t\t\t\t\t\t\t\t\t<br />\n            this feature allows to download all records of a table independent of a\n            predefined filter option\n\t\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<div>\n\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t<li>visible rows:\n\t\t\t\t\t\t\t\t\t<br />\n            in case where few records have been filtered and this option is selected then\n            then only the records fulfilling the filter criteria will be downloaded on\n            your PC\n\t\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<div>\n\t\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t\t<li>tables with dependencies:\n\t\t\t\t\t\t\t\t\t<br />\n            this feature allows you to download a table together with all related tables\n            associated through pointer and/or assignment datatype\n\t\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t\t</ul>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<ul>\n\t\t\t\t\t\t\t<li>all tables of this ginstr app: (option exclusive for ginstr apps\n          tables)\n\t\t\t\t\t\t\t\t<br />\n          this feature allows you to download all the tables of the ginstr app in one\n          go\n\t\t\t\t\t\t\t</li>\n\t\t\t\t\t\t</ul>\n\t\t\t\t\t</li>\n\t\t\t\t</ul>\n\t\t\t</div>\n\t\t\t<p>&nbsp;</p>",
