    "detailsPortlet.helpTip.content": "<h3> Edit record details</h3>\nThis portlet allows to edit the data recorded in one record of any table in the ginstr cloud.<br/>\n<br/>\nTo edit a record, the user shall click on any record of any table in the same workspace and then shall double click on any field in this portlet to update or edit the existing data.<br/>\n<br/>\nModified data is stored automatically in the database without the requirements of clicking any \"save\" button based on the following events:<br/>\n<ul>\n<li>user selects different record in same or different table</li>\n<li>user activates different portlet</li>\n<li>user activates different workspace</li>\n<li>user removes portlet content</li>\n<li>user returns to lobby</li>\n<li>user logs out</li>\n</ul>\n<br/>\n The portlet is enabled with an option, which is located at the top, to pin a table to this \"table record details\" screen.<br/>\nIn case this option is activated, clicking on a record of another table will NOT show the data of this other table.<br/>\n<br/>\nIn case the workspace comprises of more than one portlet with 'table record details' then the same allows the users to separately pin down each 'table record details' portlet to a different table respectively.",
