    "agGrid.import.dialog.help2": "<p>If the &ldquo;record created on&rdquo; column is empty in the file being uploaded, then the newly uploaded records will have a record creation date from the moment the data is uploaded. Otherwise the record creation date provided in the imported file will be used.</p>\n<p>File names and table names:</p>\n<ul>\n<li>.xlsx files:<br />For the upload of Excel files, the file and sheet names are not relevant. Each Excel sheet must provide in cell A1 the precise name of the table to which the data will be uploaded. This table name must correspond with the language selected in the &lsquo;language&rsquo; option of the file upload window.</li>\n</ul>\n<ul>\n<li>.csv files:<br />.csv file names must have the following format: &lt;table name in language of import&gt; + &ldquo;.csv&rdquo; example: customers.csv</li>\n</ul>\n<ul>\n<li>.xml files:<br />for uploading .xml files the name of the file is not relevant because all information regarding the tables is stored inside the .xml file itself</li>\n</ul>\n<p>Data with references to other tables in the ginstr cloud (not present in Excel file) can only be uploaded if the columns with the references have the &lsquo;unique&rsquo; attribute set for them.<br />In the case of an .xlsx import with both rows present (the row to which reference is made and the row containing the reference) import can be done to a non-unique row if the reference is a correct Excel reference.</p>\n<p>Please note that the data upload feature does not update records - it just creates new records.</p>\n<p>When uploading Excel .xlsx files with dates and numbers stored as Excel&rsquo;s text cell type, you should select this format in the data upload dialog box.<br />If dates and numbers are stored in an Excel file as a number cell type, then the Excel format will be used during the data upload and the format specified in the data upload dialog box will be ignored.</p>",
