    "agGrid.import.dialog.help1": "<li>language:<br />most ginstr apps are available in multiple languages. The language selection does not only affect the UI of the apps on the phone but also the headings of the tables in ginstr web.<br />With this option, you can select the language in which the headings of the table columns from uploaded .csv, .xlsx and .xml files will appear.<br />This is essential to ensure that the upload routine assigns the content of the various columns in the files to the correct equivalent columns of the ginstr tables. <br />The default language depends on your settings in the ginstr web preferences.</li>\n</ul>\n<ul>\n<li>time format:<br />ginstr supports multiple time formats. This option allows you to define in which format the data will be uploaded.<br />This is essential to ensure that the upload routine treats the timestamps in the various columns correctly. <br />For example: <br />&ldquo;10:00:00 PM&rdquo; or &ldquo;22:00:00&rdquo;; only one of these time formats can be used when importing a file in which the values are stored as text. <br />The default value depends on your settings in the ginstr web preferences.</li>\n</ul>\n<ul>\n<li>date format: <br />ginstr supports multiple date formats. This option allows you to define in which format the data will be uploaded.<br />This is essential to ensure that the upload routine treats the dates in the various columns correctly. <br />Example: <br />Two date formats can look pretty similar: dd/mm/yyyy and mm/dd/yyyy. 01/02/2017 could be 2 January 2017 or 1 February 2017. This cannot be detected automatically and therefore you must select this setting with care.<br />The default value depends on your settings in the ginstr web preferences.</li>\n</ul>\n<ul>\n<li>show thousands delimiter:<br />ginstr supports multiple number formats. This option allows you to define in which number format the data will be uploaded, i.e. 1000.00 or 1,000.00.<br />This is essential to ensure that the upload routine treats the numbers in the various columns correctly.<br />The default value depends on your settings in the ginstr web preferences.</li>\n</ul>\n<ul>\n<li>time zone:<br />ginstr internally stores all data in UTC time zone; this is the universal time which is the same worldwide. Before presenting dates and times on the screen, each timestamp is adopted to the time zone selected in your ginstr web preferences.<br />This option can be used to indicate the time zone in which the data contained in the upload file was saved.<br />The default value depends on your settings in the ginstr web preferences.</li>\n</ul>\n<ul>\n<li>choose file:<br />this option allows you to select the file on the local disk drive that contains the data to be uploaded to the ginstr cloud.</li>\n</ul>",
