    "map.helpTip.content2": "<ul>\n<li>&ldquo;edit geofence&rdquo; can be invoked by clicking on the &lsquo;hand&lsquo; icon.<br /> The &lsquo;edit geofence&lsquo; action can be terminated by clicking anywhere outside the geofence.<br /> After clicking on the &ldquo;edit&rdquo; button each corner of the geofence will appear with a white box.<br /> By clicking and dragging such a box around the map you can edit the positions of the vertices of the <br /> If this geofence has more than three vertices, then clicking on a vertex box will remove that vertex.<br /> Within the white boxes appears a \"transparent\" box which can be clicked and dragged to create new vertices in the geofence. <br /> Invalid geofence shapes are identified by a pink color during edit.<br /> A triangle is the simplest geofence you can draw.</li>\n<li>&ldquo;delete geofence&rdquo; can be invoked by clicking on the &ldquo;trash can&rdquo; icon.</li>\n</ul>\n<p><strong>Dropdown menu actions:</strong></p>\n<p>When hovering over the &ldquo;planet&rdquo; icon in the top left corner of the map widget, a dropdown menu opens with following options:</p>\n<ul>\n<li>geofences:<br /> show / hide geofences</li>\n<li>OpenSeaMap:<br /> shows / hides the OpenSeaMap map layer which provides maritime information (buoys, lighthouses etc.)</li>\n<li>search:<br /> permanently shows / hides an input field allowing you to search for an address as follows:\n<ul>",
    "map.helpTip.content1": "<p>You have the following options to zoom the map:</p>\n<ul>\n<li>scrolling with the mouse wheel:<br /> zooms the map in or out</li>\n<li>&lsquo;plus&lsquo; and &lsquo;minus&lsquo; buttons in the top left corner of this map portlet:<br /> zooms the map in or out</li>\n<li>clicking on the zoom slider at the left border of this map portlet:<br /> zooms the map to the selected zoom level</li>\n</ul>\n<p><strong>Actions with pushpins:</strong></p>\n<p>Each pushpin provides a popup displaying all data stored in the related record.</p>\n<p>You can see such data by hovering with the mouse over the pushpin.</p>\n<p>If you click on a pushpin the popup stays open until you close it by either clicking on the &lsquo;x&rsquo; in the top right corner of the popup or by clicking somewhere on the map.</p>\n<p><strong>Actions with geofences:</strong></p>\n<p>Each geofence provides a popup with actions.</p>\n<p>You can see this popup by clicking anywhere on a geofence.</p>\n<p>The following actions are available for geofences:</p>",
