    "map.helpTip.content4": "<ul>\n<li>geofences:<br /> show / hide geofences</li>\n<li>OpenSeaMap:<br /> shows / hides the OpenSeaMap map layer which provides maritime information (buoys, lighthouses etc.)</li>\n<li>search:<br /> permanently shows / hides an input field allowing to search for an address as follows:\n<ul>\n<li>You can enter an address, or a part of an address into the address field.<br /> A list of results will be shown automatically. You do not need to hit the &ldquo;enter&rdquo; button.<br /> You can select any address from this list of hits by clicking on it.</li>\n<li>As soon as you click on one address, the map will be panned to this location without changing the zoom level and a pushpin will be shown at the selected address location.</li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>",
    "app_emma_processServicesRenderedPlugin": "incidents processor",
    "sso.application.caretakerReport": "care taker report",
    "map.helpTip.content3": "<li>You can enter an address, or a part of an address into the address field.<br /> A list of results will be shown automatically. You do not need to hit an &ldquo;enter&rdquo; button to see the results.<br /> You can select any address from this list of hits by clicking on it.</li>\n<li>As soon as you click on one address, the map will be panned to this location without changing the zoom level and a pushpin will be shown at the selected address location.</li>\n</ul>\n</li>\n</ul>\n<p><strong>Right mouse-click options:</strong></p>\n<p>When clicking anywhere inside the map with the right mouse button, a context menu opens providing the following options:</p>\n<ul>\n<li>add geofence:<br /> Allows you to draw a new geofence.<br /> Terminating your geofence can be completed as follows:<br /> - by clicking on the start point of the polygon, or<br /> - by double clicking somewhere on the map which will create.</li>\n<li>show / hide content:<br /> opens a submenu with the following options<br /><br />",
