    "calendarPortlet.helpTip.content4": "<p>&nbsp;</p>\n<h3>View events overflow:</h3>\n<p>If the number of selected events exceeds the available space, the calendar portlets will respond as follows:</p>\n<ul>\n<li>&lsquo;Month&rsquo; view:</li>\n<p>If the number of events is higher than the available space in the day slot, extra events will be hidden. The last row in the day slot will display a link with the label &lsquo;+n more&rsquo;.</p>\n<p>In this case &lsquo;n&rsquo; is the number of hidden events in current day slot link. The user can view hidden events by clicking this link.</p>\n<li>All views:</li>\n<p>Each event has a tooltip with all data; the user can see it by hovering over an event.</p>\n</ul>",
    "error.4010": "the geofence has been disabled",
    "aggrid.document.hover.filename": "file name:",
    "calendarPortlet.endField.label": "end column",
    "calendarPortlet.helpTip.content3": "</ul>\n<p>&nbsp;</p>\n<h3>Interactions of the calendar portlet with a ginstr table:</h3>\n<p>Clicking on one record:</p>\n<p>The event contained in this record will be automatically shown in the calendar portlet.</p>\n<p>&nbsp;</p>\n<p>Selecting multiple records (e.g. with CTRL and/or SHIFT key):</p>\n<p>If the user selects multiple records in a table with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; columns that cover a total timeframe longer than the timeframe currently covered by selected view in calendar widget (e.g. several months in case &lsquo;Work Week&rsquo; view is selected) then the end of the time frame covered by the selected events will be shown.</p>\n<p>&nbsp;</p>\n<p>If the user selects records that have no column with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype then there will be no events displayed in the calendar portlet.</p>\n<p>&nbsp;</p>\n<h3>Event labels configuration</h3>\n<p>Clicking on the icon with the three horizontal bars in the top right corner of the calendar portlet allows for the following configuration:</p>\n<ul>\n<li>Column(s) to be displayed:</li>\n<p>Allows the user to select which columns should be used as labels for events. This setting supports selection of a single column or of multiple columns.</p>\n<p>Options in dropdown menu are shown in same order as the corresponding columns in the table.<br /> Columns with one of the following datatypes cannot be selected:</p>\n<ul>\n<li>'date'</li>\n<li>'time'</li>\n<li>&rsquo;date &amp; time'</li>\n<li>'date &amp; time difference'</li>\n<li>'audio'</li>\n<li>'documents'</li>\n<li>'list of dates'</li>\n<li>'list of dates &amp; times'</li>\n<li>'list of times'</li>\n<li>'pictures'</li>\n<li>'signature'</li>\n<li>'video'</li>\n</ul>\n</ul>\n<p>All other columns are available for selection.</p>",
    "error.4012": "Not possible to delete geofence. There are references to the geofence entry.",
