    "calendarPortlet.helpTip.content2": "<p>If &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; of left column is later than &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; of right column, then both columns will be swapped.</p>\n<p>If there is a mix of multiple &lsquo;date&rsquo; and &lsquo;date &amp; time&rsquo; cells in one record, then the leftmost cell with a &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype determines the datatype used for the event.</p>\n<p>&nbsp;</p>\n</ul>\n<p>Examples:</p>\n<ul>\n<li>Leftmost column with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-1) has datatype &lsquo;date&rsquo;;</li>\n<p>next column to the right with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-2) has datatype &lsquo;date&rsquo;;</p>\n<p>next column to the right with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-3) has datatype &lsquo;date &amp; time&rsquo;: in this case the event will be between date-1 and date-2.</p>\n<li>Leftmost column with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-1) has datatype &lsquo;date &amp; time&rsquo;; next column to the right with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-2) has datatype &lsquo;date&rsquo;;</li>\n<p>next column to the right with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-3) has datatype &lsquo;date &amp; time&rsquo;:</p>\n<p>in this case the event will be between date-1 and date-3.</p>\n<li>Leftmost column with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-1) has datatype &lsquo;date &amp; time&rsquo; and value December 24, 2017 10:20:30;</li>\n<p>next column to the right with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-2) has datatype &lsquo;date &amp; time&rsquo; and value December 24, 2017 22:33:44;</p>\n<p>next column to the right with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-3) has datatype &lsquo;date&rsquo;:</p>\n<p>in this case the event will be from December 24, 2017 10:20:30 until December 24, 2017 22:33:44.</p>\n<li>Leftmost column with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-1) has datatype &lsquo;date &amp; time&rsquo;. The next column to the right with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-2) has datatype &lsquo;date&rsquo;. The next column to the right with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatype (date-3) has datatype &lsquo;date&rsquo;. In this case the event will be on date-1.</li>",
    "calendarPortlet.helpTip.content1": "<h3>Events presentation:</h3>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li>&lsquo;Month&rsquo; view:</li>\n<p>events are shown according to start and end date (time information is ignored if present).</p>\n<p>In &lsquo;Month&rsquo; view events can be displayed in two ways:</p>\n<li>For events with start and end columns with a &lsquo;date&rsquo; datatype:</li>\n<p>filled block with colour of selected record, or ginstr blue by default if record has no assigned colour</p>\n<li>For events with start and end columns with a &lsquo;date &amp; time&rsquo; datatype:</li>\n<p>underlined transparent block with bullet - colour taken from selected record or ginstr blue by default if record has no assigned colour</p>\n<li>&lsquo;Week&rsquo; / &lsquo;Day&rsquo; / &lsquo;Work Week&rsquo; view:</li><br />\n<ul>\n<li>&lsquo;date &amp; time&rsquo; datatype:</li>\n<p>events are shown according to start and end date and times</p>\n<li>&lsquo;date&rsquo; datatype:</li>\n<p>events are shown in &lsquo;all day&rsquo; section of the calendar portlet</p>\n<li>&lsquo;date &amp; time&rsquo; datatype with only 1 column:</li>\n<p>events are shown according to start date and time with minimum height (one line of text)</p>\n<li>events that are longer than one day are shown in the &lsquo;all day&rsquo; section of the calendar portlet</li>\n</ul>\n</ul>\n<p>Depending on the order of &lsquo;date&rsquo; and/or &lsquo;date &amp; time&rsquo; columns, events are presented in different ways. This order can be changed by drag &amp; drop column headers in the table.</p>\n<p>&nbsp;</p>\n<p>Examples:</p>\n<ul>\n<li>1 column with &lsquo;date&rsquo; datatype containing December 24, 2017:</li>\n<p>in this case the event lasts from December 24, 2017 00:00:00 until December 24, 2017 23:59.59.</p>\n<li>1 column with &lsquo;date &amp; time&rsquo; datatype containing December 24, 2017 10:20:30:</li>\n<p>In this case the event does not have a duration, so the column value is taken from the start time and the event occupying the least height (one line of text) for &lsquo;Week, Day, Work Week views. For Month view the event lasts from December 24, 2017 00:00:00 until December 24, 2017 23:59.59 - the &lsquo;time&rsquo; part of the &lsquo;date &amp; time&rsquo; data is ignored</p>\n<li>2 columns with &lsquo;date&rsquo; datatype containing December 24, 2017 and December 26, 2017:</li>\n<p>in this case the event lasts from December 24, 2017 00:00:00 until December 26, 2017 23:59.59.</p>\n<li>2 columns with &lsquo;date &amp; time&rsquo; datatype containing December 24, 2017 10:10:10 and December 26, 2017 20:20:20:</li>\n<p>in this case the event lasts from December 24, 2017 10:10:10 until December 26, 2017 20:20:20.</p>",
