    "ag.table.date.defaultFilter.currentMonth": "current month",
    "calendarPortlet.helpTip.content": "<p>This calendar portlet allows the user to view selected records of any active (or pinned) ginstr table that has one or multiple columns with &lsquo;date&rsquo; or &lsquo;date &amp; time&rsquo; datatypes.</p>\n<p>A &lsquo;date&rsquo; column describes a particular day, e.g. December 24, 2017.</p>\n<p>A &lsquo;date &amp; time&rsquo; column holds some time information in addition to the date, e.g. December 24, 2017 23:48:59.</p>\n<p>&nbsp;</p>\n<h3>Events:</h3>\n<p>Each selected data record will be presented as an &lsquo;event&rsquo; in this calendar portlet. Each event has a start time and an end time (duration).</p>\n<p>&nbsp;</p>\n<h3>The following buttons exist in this calendar widget:</h3>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li>Month:</li>\n<p>show events in one-month range.</p>\n<li>Week:</li>\n<p>show events in one-week range.</p>\n<li>Day:</li>\n<p>show events in one-day range.</p>\n<li>Work Week:</li>\nshow events in working week range<br />\n(the first working day of a week can be set in ginstr web account settings).<br /><br />\n<li>Today:</li>\n<p>switch to current local date (taken from your computer)</p>\n<li>Back:</li>\n<p>switch to previous Month / Week / Day / Work Week (depending on currently selected view)</p>\n<li>Next:</li>\n<p>switch to next Month / Week / Day / Work Week (depending on currently selected view)</p>\n<li>Pin this portlet to table:</li>\nwhen this option is activated, clicking on a record in another table will NOT show the data of the record in this other table.<br />\nInstead, the calendar will continue showing the data of the table it is pinned to.\n</ul>\n",
