    "ag-table.helpTip.content2": "<h3>SELECTING RECORDS</h3>\nWhen clicking on any record in any table then it gets blue. This indicates that this record is 'selected'.<br>\nWhen clicking on one record in a table and then shift-click on another record of the same table then all records between the first clicked record and the second clicked record as well as the two clicked records are selected (marked blue).<br>\nWhen clicking on one record and then ctrl-click on another record then this second record is added to the list of selected records and marked blue. ctrl-click allows adding multiple individual records to the selection set.<br>\n<br>\nSelecting records is useful in many different situations.<br>\n<br>\nExamples:\n<ul>\n<li>If the records contain a column with GPS coordinates and the same workspace contains as portlet with a map then pushpins are shown on the map at the GPS coordinate of each <u>selected</u> record.</li><br>\n<li>If you select one or multiple records and then hit the DEL key on the keyboard then you can delete all selected records at the same time after confirming a security question. Please note that deleting records cannot be reverted.</li><br>\n<li>If you select multiple records and then assign a colour to them then this colour is assigned to all selected records at the same time. This is more efficient than assigning the same colour to each record individually.</li><br>\n<li>If you select a single record and a 'edit record details' portlet is present in the same workspace then the details of the selected record will be shown in the 'edit record details' portlet.</li><br>\n<li>If you select multiple records of a table with shift-click and/or ctrl-click then an additional 'action' button is shown above the table. This button provides the following options:<br>\n- remove all selected records permanently<br>\n- assign a colour to all selected records</li><br>\n<li>If you select multiple records in a table which is pointed with a 'pointer' datatype column in a second table then in the second table all records are filtered which are pointing to any of the selected records in the first table.<br>\nThis is only true if the 'filter this table depending on selection of pointed table' option is activated for the pointer datatype column.</li>\n</ul>",
    "sso.application.relocationConsulting": "relocation consultant",
    "geofence.leave.alarm.email.subject": "[{date}] GEOFENCE LEFT: trackable={device} / geofence={geofence}",
    "date.pattern._full": "EEEE dd, MMMM yyyy",
    "ag-table.helpTip.content1": "<h3> SORTING of tables (clicks on column headers) </h3>\nClicking on column headers affects sorting (or multiple sorting) as follows:  \n<ul>\n<li>When clicking on a header of a column which is not sorted then ascending sorting for that column is applied</li> \n<li>When clicking on a header of a column which is already sorted then sorting is toggled (asc =&gt; desc // desc =&gt; asc)</li> \n<li>If a column is already sorted then ctrl+click on that header removes the sorting (arrow is removed);<br>this has no influence on the sequence of rows if only one column is sorted but affects the sorting in case multiple columns are sorted</li> \n</ul>\n\n<ul>\n<li>Ctrl+click on multiple headers activates sorting by all these columns (arrow appears on each column)</li>\n<li>Sorting priority depends on the sequence you clicked the columns when adding them to the sorting selection</li>\n<li>If sorting is applied on multiple columns then ctrl+click on a column that already has applied sorting to it will change the sorting order (asc/desc) for that column</li>\n<li>If multiple sorting is applied then clicking on a column header without holding the ctrl button will remove all multiple sorting settings and will just activate the sorting for the column that was clicked</li>\n</ul>\n\n<h3>SEARCHING in tables (click into table cells)</h3>\n<ul>\n<li>Clicking into a cell of a table will select that row but will also add that column to the search selection (header becomes dark blue).<br>This means that as soon as at least one column has a dark blue header the search string entered in the top left corner will only be applied to the column(s) with the blue header.</li>\n<li>Ctrl+click on some cell in some other column will add this column to the search selection;<br>If the user clicked into a different row than previous clicked cell was in then this row will also be marked as selected.</li>\n<li>Ctrl+click on some column which is already selected removes this column from the search selection;<br>If the clicked cell is in a row that is also selected this row will become unselected.</li>\n<li>Clicking into a cell and then shift+click into some other cell in a column left or right from first clicked column adds all columns between the two clicked columns including the two clicked columns to the search selection; their headers will be marked with dark blue;</li>\n<li>If cell that is clicked while holding shift is in row that is not selected all rows between already selected row and that one where this cell is will be selected</li>\n<li>If multiple selection of columns / rows is activated and then user clicks into any cell then the multiple search selection is cleared and only the clicked column is part of the search selection; in this case only the row in which the clicked cell is will be marked.</li>\n</ul>",
