    "agfilter.table.dialog.helpcontent": "This filter section allows setting and storing permanent filter settings for each column of a table.<br>\n<br>\nIf a filter is currently applied to a table in a portlet then the small filter icon in the top right corner of the portlet showing the table has a turquoise background.<br>\n<br>\nIn case multiple tabs with different views of the data of a table have been configured in the same portlet then these filter settings are applied to all these tabs.<br>\nIn case you need to apply different filters to the same table at the same time then please load the same table into multiple portlets and apply the different filters to the different portlets.<br>\n<br>\nThe filter settings are stored even after logout for each user. This means that if you log in next time to your ginstr account even on another PC you will find the same filter settings.<br>\nIf you log out / log in again or reload ginstr web web page then table will not be filtered anymore and icon will not be turquoise but if you click on the filter icon there will be no default filter values but the ones that were set before logging out so you will just need to click on ‘apply’ and the table will be filtered again.<br>\n<br>\nFor launching the filter settings screen please tap on the filter icon in the top right corner of the portlet.<br>\n<br>\nIn order to drag the newly opened popup screen to another position on the screen just mouse over the header of the filter popup screen. Now the mouse pointer changes and a symbol with 4 arrows is shown. Now please click with the left mouse button and keep the mouse button pressed. Now drag the filter popup screen to the desired position on the screen and release the left mouse button.<br>\n<br>\nOn top of the filter settings popup window you can find the following buttons:<br>\n<br>",
