    "pentaho.helpTip.content": "This portlet provides formatted reports.\n\n \n\nThe following features are available:\n\n \n\n<h3>update report(s)</h3>\n\n \n\nUpdates the report(s) currently shown in this portlet<br>\n\n \n\n<h3>CSV export</h3>\n\n \n\nExports the reports currently shown in this portlet to a .csv file.<br>\n\nDepending on the current settings of your browser, the exported file will be either provided automatically in your ‚download‘ folder or you will be prompted with a request to select the folder where the file should be stored.<br>\n\nWhen exporting a formatted report to a .csv file all formatting is lost.\n\n \n\n<h3>XLS export</h3>\n\n \n\nExports the reports currently shown in this portlet to a .xlsx file (Microsoft Excel 2007+ format).<br>\n\nDepending on the current settings of your browser, the exported file will be either provided automatically in your ‚download‘ folder or you will be prompted with a request to select the folder where the file should be stored.<br>\n\nWhen exporting a formatted report to a .xlsx file most formatting is maintained depending on Excel functionality.\n\n \n\n \n\n<h3>PDF export</h3>\n\n \n\nExports the reports currently shown in this portlet to a .pdf file (portable document format).<br>\n\nDepending on the current settings of your browser, the exported file will be either provided automatically in your ‚download‘ folder or you will be prompted with a request to select the folder where the file should be stored.<br>\n\nWhen exporting a formatted report to a .pdf file all formatting is maintained.\n\n \n\n<h3>Word export</h3>\n\n \n\nExports the reports currently shown in this portlet to a .rtf file (Rich Text Format).<br>\n\nDepending on the current settings of your browser, the exported file will be either provided automatically in your ‚download‘ folder or you will be prompted with a request to select the folder where the file should be stored.<br>\n\nWhen exporting a formatted report to a .rtf file all formatting is maintained.\n\n \n\n<h3>separate file per report</h3>\n\n \n\nIn case multiple reports are shown in this portlet, by activating this option you can ensure that during export, each report will be saved in a separate file instead of creating one file with multiple pages. The individual reports will be grouped into one .zip file.<br>\n\nDepending on the current settings of your browser the exported .zip file will be either provided automatically in your ‚download‘ folder or you will be prompted with a request to select the folder where the file should be stored.<br>\n\n \n\n<h3>adopt reports to selection in table</h3>\n\n \n\nIn case this feature is activated, the reports shown in this portlet will be instantly adopted to the record selection in the related table.<br>\n\nIn case multiple records are selected, then multiple reports will be shown.<br>\n\nIn case this option is NOT activated, the content of this portlet will NOT be adopted to the records selected in the related table.<br>\n\nBy default this option is activated.\n\n \n\n<h3>pin this portlet to table</h3>\n\n \n\nThis option allows linking a table to portlet permanently.<br>\n\nAs long as just one portlet with formatted reports and one related table are shown in the workspace, the reports in this portlet will always represent data of the related table.<br>\n\nIn case multiple tables are in different portlets of the same workspace, the data in the portlet with formatted reports will be related to the table that you previously selected.\n\nThis means, if you click on portlet-1 then formatted reports will be based on data of the table shown in portlet-1. If you click on portlet-2 then formatted reports will be shown based on data of the table shown in portlet-2.<br>\n\nIn case this option is activated, then clicking into portlet-1 or portlet-2 will NOT change the content of the portlet with formatted reports.\n\n \n\n<h3>automated reports</h3>\n\n \n\nThis option allows you to set up automated formatted reports. This means, you can activate a routine that will send on a regular basis (e.g. daily, weekly, monthly) e-mails with attachments containing formatted reports for the given time period.",
