    "PUBLISH_APP_INTERNAL_SERVER_ERROR": "seems like something went wrong in ginstr cloud; please contact the system administrator",
    "agfilter.table.dialog.helpcontent2": "The content of the filter popup screen depends on the related table: for each <u>visible</u> column of the table a section is shown for applying a filter related to that column. The left to right sequence of the columns in the table is reflected by the top - down sequence of the sectionsEn shown in the filter popup screen.<br>\n<br>\nEach section on the filter popup screen shows a 'clear' button which allows clearing the filter settings applied to this table column. Clearing a filter option will only be effective after clicking on the 'apply' button on top of the screen.<br>\n<br>\nHow to enter the filter settings is obvious for most columns. Here are some hints for some columns with more sophisticated data types:<br>\n<br>\nDATE data type:<br>\nClicking on the small calendar icon in the top right corner of a calendar filter section hides/opens the calendar view in this section. The filter settings are not changed when hiding/opening the calendar view.<br>\n<br>\nTIMESTAMP data type (date and time in same column):\nClicking on the small calendar icon in the top right corner of a calendar filter section hides/opens the calendar view in this section. The filter settings are not changed when hiding/opening the calendar view.<br>\nThe 'show latest entry only' option allows to show the latest record per any column of the same table.<br>",
    "agfilter.table.dialog.helpcontent3": "Examples:<br>\n<ul>\n<li>in case you are recording visits of checkpoints of security guards you can filter the list for example for seeing the last booking of each security guard at the same time</li>\n<li>in case you are recording 'coming' and 'leaving' of employees you could filter the bookings of all employees with latest status 'coming' to see who is currently e.g. on a construction site</li>\n<li>in case you are renting out tools to customers you could filter the rentals and returns of all tools with latest status 'coming' to see which tool is currently on stock</li>\n</ul>\nGPS data type:<br>\nGPS data type filter fields can be filled with the two GPS coordinates of the corners of the selected area as follows:<br>\na) make sure that one of the portlets in the actual workspace shows a map in optimal zoom level and geographic area<br>\nb) open the filter by clicking on the filter icon in top right corner of the portlet<br>\nc) shift + click on the map in top left corner of the desired area and keep the left mouse button pressed<br>\nd) drag the mouse to the lower right corner of the desired area and release the mouse button<br>\nnow all 4 values of the GPS filter are filled with the selected GPS coordinates<br>",
    "agfilter.table.dialog.helpcontent4": "<br>\nhidden columns:<br>\nhidden columns can be found at the bottom of the filter dialog with hint ’hidden’. This allows filtering the table also by those hidden columns.",
    "PROJECT_NAME_PLACEHOLDER": "app name",
