    "agfilter.table.dialog.helpcontent1": "reset to default:<br>\nclicking on this button resets the filter settings to the default values as follows: all filters are cleared and to all date and timestamp (date & time) columns a filter is applied for filtering all these columns for showing only records which match the default-filter settings defined for this table in table edit mode.<br>\nIn case no default filter is defined these filters will be reset to 'today', if some other value is defined as default (for example 'previous year') then it will be reset to that other value.<br>\nFilters for columns of 'status' data type and 'signature' data type will be reset to value ‘any’.<br>\n<br>\nclear filters: <br>\nwhen clicking on this button all filters are cleared including the 'date' and the 'date and time' filters.<br>\n<br>\napply:<br>\nwhen clicking on the 'apply' button then all previously entered filter options are applied to the related table. The popup screen is NOT closed in this case so in case the selected filter options do not yet provide the expected results you can refine them by just modifying some filter settings and clicking on the apply button again.<br>\nFor closing the window please click on the 'x' next to the 'apply' button.<br>\n<br>",
