    "agGrid.import.dialog.help": "<p>This data upload feature allows you to upload data stored on your local PC to ginstr tables on the ginstr cloud.</p>\n<p>To upload data to a ginstr table or any ginstr app, right click anywhere in the table and then select the &lsquo;upload data&rsquo; option. You will then see the upload dialog box which allows you to specify the upload details.</p>\n<p>ginstr web matches data from the upload file to the individual columns of the ginstr table using the column headings.<br />In order to ensure that the headings of the tables being uploaded match correctly, it is recommended that you first download the existing table(s) (even if they are empty) from ginstr web and use these files for adding the data you want to upload.</p>\n<p>The following options are available to configure the data upload:</p>\n<ul>\n<li>upload data<br />\nTo upload data to the ginstr cloud you do not have to select if this data has been previously downloaded with or without attachments. One of following options is instead required:\n<ul>\n<ul>\n<li>upload data to this table only:<br />uploads data only to the table for which this upload dialog box is opened</li>\n</ul>\n</ul>\n<br />\n<ul>\n<ul>\n<li>upload all dependent tables:<br />uploads data to the table for which this upload dialog box is opened as well as to all tables connected through pointer or assignment datatype</li>\n</ul>\n</ul>\n<br />\n<ul>\n<ul>\n<li>in all tables of this ginstr app:<br />uploads data to all tables related to the relevant ginstr app including the one for which the upload dialog box is open</li>\n</ul>\n</ul>\n<br />\n</li>",
